var nextSlide = document.querySelector(".btn-next"); // current slide counter

var curSlide = 0; // maximum number of slides

var maxSlide = slides.length - 1; // add event listener and navigation functionality

nextSlide.addEventListener("click", function () {
  // check if current slide is the last and reset current slide
  if (curSlide === maxSlide) {
    curSlide = 0;
  } else {
    curSlide++;
  } //   move slide by -100%


  slides.forEach(function (slide, indx) {
    slide.style.transform = "translateX(".concat(100 * (indx - curSlide), "%)");
  });
}); // select next slide button

var prevSlide = document.querySelector(".btn-prev"); // add event listener and navigation functionality

prevSlide.addEventListener("click", function () {
  // check if current slide is the first and reset current slide to last
  if (curSlide === 0) {
    curSlide = maxSlide;
  } else {
    curSlide--;
  } //   move slide by 100%


  slides.forEach(function (slide, indx) {
    slide.style.transform = "translateX(".concat(100 * (indx - curSlide), "%)");
  });
});

